import { MDBContainer } from 'mdbreact';
import React, { Component } from 'react';
import Collection from '../../../components/user/Collection';
import Footer from '../../../components/user/Footer';
import HeaderNotLogin from '../../../components/user/HeaderNotLogin';
import SlideProduct from '../../../components/user/SlideProduct';
import Carousel from './Carousel';

class Home extends Component {
    render() {
        return (
            <div>
                <header>
                    <HeaderNotLogin />
                    <Carousel />
                </header>
                <main>
                    <MDBContainer>
                        <SlideProduct/>
                        <Collection/>
                    </MDBContainer>
                </main>
                <footer>
                    <Footer/>
                </footer>
            </div>
        );
    }
}

export default Home;
